import React from "react";
import "./projectcomponent.css";


function ProjectComponent(props){
    return(

          <div
            className=" p-10 text-white w-80 rounded-lg my-10 mx-10 divide-y-2 " 
            id ="shad" //custom css cause tailwind can't do it
            style={{backgroundColor:"#464141" }}
            //add a second box shadow in with a unique color lol
          >
            <h1 className="text-xl m-1">{props.title}</h1>
            <p>{props.text}</p>
          </div>

    );
}

export default ProjectComponent;
